import React, { useEffect } from "react";

// # Challenge: Create a Not Found page

// Acceptance Criteria
//   - Title of '404 - Not Found'
//   - A parent div with a background of 'bg-gray'
//   - A child div with 'mx-auto max-w-screen-lg' classes
//   - Inside the child div have a paragraph with the classes 'text-center text-2xl', and the text to be 'Not Found!'

// Hints
//   - setting the document title must be called on first render

// References
//   - https://reactjs.org/docs/hooks-effect.html
//   - Check the Tailwind CSS documentation! (Super important!)

export default function NotFound() {
  useEffect(() => {
    document.title = "404 - Not Found";
  });

  return (
    <div className="bg-gray-200">
      <div className="mx-auto max-w-screen-lg">
        <p className="text-center text-2xl">Not Found!</p>
      </div>
    </div>
  );
}
